window.bookSummaryJSON = "Garrison Keillor is the consummate storyteller, gifted with the rare ability, both in print and in performance, to hold an audience spellbound with his tales of ordinary people whose lives contain extraordinary moments of humor, tenderness, and grace. This exclusive recording of Garrison Keillor reading a carefully edited abridgement of the book also includes a few segments taken from live performances recorded during a fundraising tour for public radio stations in 1985."; 
